message:
@Drmarcelofrazao, tendo em vista a portaria interministerial permitindo o ingresso de funcionários do Alto regime venezuelano e considerando que os EUA tem um prêmio de 15 milhões pra quem entregar o Maduro. O senhor acha que podemos estar "facilitando" isso aos americanos em troca de: 
A) nenhuma sanção;
B) "aceite" do Brasil tratar minerais nucleares conforme a lei 14.514 de hoje.

Considerando também  o reforço nas fronteiras principalmente com a Venezuela.

Acredita ser uma possibilidade?
